import React from "react";
import SearchBar from '../SearchBar/SearchBar'

const Nav = ({onSearch}) => {
    return (
        <div style={{
            position: "relative",
            width: '90%'
        }}>
            <SearchBar onSearch={onSearch} />
        </div>
    )
}

export default Nav
